import React from "react";
import "./card.scss";
import { Link } from "react-router-dom";

const Card = ({item}) => {
    return (
        <Link to={`/product/${item.id}`}>
            <div className="card">
                <div className="image"></div>
            </div>
        </Link>
    )
};

export default Card;
